import React, { useEffect, useState } from 'react';
import { Button, Container, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, TextField, Typography } from '@mui/material';
import { useDispatch, useSelector } from 'react-redux';
import { createEmployeeAccess, deleteEmployeeAccess, fetchEmployeeAccess, updateEmployeeAccess } from '../redux/slices/employeeAccessSlice';

function EmployeeAccessCrud() {
    const dispatch = useDispatch();
    const employeeAccess = useSelector((state) => state.employeeAccess.employeeAccess);
    const [formData, setFormData] = useState({
        name: '',
        granted: false,
    });

    useEffect(() => {
        dispatch(fetchEmployeeAccess());
    }, [dispatch]);

    const handleFormChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleAddRecord = () => {
        dispatch(createEmployeeAccess(formData));
        setFormData({ name: '', granted: false });
    };

    const handleUpdateRecord = (id, updatedData) => {
        dispatch(updateEmployeeAccess({ id, updatedData }));
    };

    const handleDeleteRecord = (id) => {
        dispatch(deleteEmployeeAccess(id));
    };

    return (
        <Container>
            <Typography variant="h4" gutterBottom>
                Управление доступом сотрудников
            </Typography>
            <Paper elevation={3} style={{ padding: '20px', marginBottom: '20px' }}>
                <TextField
                    name="name"
                    label="Имя"
                    value={formData.name}
                    onChange={handleFormChange}
                    fullWidth
                    margin="normal"
                />
                <TextField
                    name="granted"
                    label="Доступ разрешен"
                    type="checkbox"
                    checked={formData.granted}
                    onChange={handleFormChange}
                    fullWidth
                    margin="normal"
                />
                <Button variant="contained" color="primary" onClick={handleAddRecord}>
                    Добавить запись
                </Button>
            </Paper>
            <TableContainer component={Paper}>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Номер</TableCell>
                            <TableCell>Имя</TableCell>
                            <TableCell>Доступ разрешен</TableCell>
                            <TableCell>Действия</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {employeeAccess.map((row, index) => (
                            <TableRow key={row._id}>
                                <TableCell>{index + 1}</TableCell>
                                <TableCell>{row.name}</TableCell>
                                <TableCell>{row.granted ? 'Да' : 'Нет'}</TableCell>
                                <TableCell>
                                    <Button variant="contained" color="primary" onClick={() => handleUpdateRecord(row._id, { name: 'Updated Name', granted: true })}>
                                        Обновить
                                    </Button>
                                    <Button variant="contained" color="secondary" onClick={() => handleDeleteRecord(row._id)}>
                                        Удалить
                                    </Button>
                                </TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </Container>
    );
}

export default EmployeeAccessCrud;
